é considerado o mais eficiente sistema de fortificações de campo da História militar. Construido a 353m de altitude, está localizado à direita do desfiladeiro de Matos, e era inicialmente designado de Forte de S. Sebastião, mas por se situar no Casal do Cego, local onde habitou a famosa Bruxa de Arruda, passou a designar-se de Forte do Cego.
